import React, { useState, useEffect } from "react";
import axios from "axios";

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [selectedFilter, setSelectedFilter] = useState("");
  const [selectedFilterValue, setSelectedFilterValue] = useState("");
  const pageSize = 25;

  const filterOptions = {
    name: "name",
    city: "city",
    state: "state",
    categories: "categories",
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&${selectedFilter}=${selectedFilterValue}`
        );
        setBusinessData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [currentPage, selectedFilter, selectedFilterValue]);

  const handleAddFilter = () => {
    console.log(selectedFilter);
    console.log(selectedFilterValue);
    if (selectedFilter && selectedFilterValue) {
      setSelectedFilter("");
      setSelectedFilterValue("");
    }
  };

  return (
    <div className="p-3">
      <div className="mb-3">
        <label htmlFor="selectedFilter" className="form-label">
          Select Filter:
        </label>
        <select
          id="selectedFilter"
          className="form-select"
          value={selectedFilter}
          onChange={(e) => setSelectedFilter(e.target.value)}
        >
          <option value="" disabled>
            Select Filter
          </option>
          {Object.entries(filterOptions).map(([key, value]) => (
            <option key={key} value={key}>
              {value}
            </option>
          ))}
        </select>
      </div>

      <div className="mb-3">
        <label htmlFor="selectedFilterValue" className="form-label">
          Filter Value:
        </label>
        <input
          type="text"
          id="selectedFilterValue"
          className="form-control"
          value={selectedFilterValue}
          onChange={(e) => setSelectedFilterValue(e.target.value)}
        />
      </div>

      <button className="btn btn-primary" onClick={handleAddFilter}>
        Add Filter
      </button>

      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="d-flex justify-content-between align-items-center mb-3">
        <button
          className="btn btn-primary"
          onClick={() =>
            setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
          }
          disabled={currentPage === 1}
        >
          Previous Page
        </button>
        <span className="h5"> Page {currentPage} </span>
        <button
          className="btn btn-primary"
          onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
        >
          Next Page
        </button>
      </div>
    </div>
  );
}
